export interface LoginPageProps {}
export const LoginPage = (props: LoginPageProps) => {
    let handleLogin = () =>{
        alert('Login')
    }
	return (
		<div className="container">
            <h1>Student Login</h1>
			<button onClick = {()=>handleLogin()}>Login</button>
		</div>
	);
};
